import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Footer from '../Components/Footer';

class RestaurantData extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>{this.props.rest.name}</h1>
        <img src={this.props.rest.image} class="cover-image" />
        <p></p>
        <h4>Restaurant: {this.props.rest.name}</h4>
        <h4>Cuisine: {this.props.rest.cuisine}</h4>
        <h4>Location: {this.props.rest.location}</h4>
        <h4>Hours Open: {this.props.rest.hours_open}</h4>
        <h4>Phone Number: {this.props.rest.phone_number}</h4>
        <h4>Average Rating: {this.props.rest.avg_rating}</h4>
        <h4>Price: {this.props.rest.price}</h4>
        <h4>Currency: {this.props.rest.currency}</h4>
        <h4>Online Order: {this.props.rest.online_order}</h4>
        <h4>Table Booking: {this.props.rest.table_booking}</h4>
        <Footer />
      </div>
    );
  }
}

export default RestaurantData;
